import React, { Component } from 'react';
import '../App.css';
import location from '../location1.png'
import linkedin from '../linkedin1.png'
import git from '../git1.png'

class Home extends Component {
  render() {
    return (

      <div className="App">


<div class="container-fluid" id="maincontainer">

<div class ="row" id="rowheading">
<div class="col">
<p class="text-left" id="helloheading2">Hello, I'm Hammad</p>
<p class="text-left" id="firstpara">I am a Colorado-based web-developer, currently pursuing my Computer Science degree from MSU DENVER</p>
</div>
</div>
<div class ="row" id="rowheading">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="heading">Skills & Experience</p>
</div>
</div>

<div class ="row" id="rowsingleline">
<div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
<p class="text-left" id="singlepara">The main area of my expertise is front-end web development (client-side). HTML, CSS JS(ES2015), React.js building small and medium web applications with React.js, custom plugins, features, animations and coding interactive layouts  I have also Full stack experience with Microsoft technologies such as MVC, Entity Framework, C#, SQL and VB.net along with some open-source CMS like Wordpress, Drupal, Magneto and others      </p>
</div>
</div>
<div class="container" id="footer">  </div>
</div>
      </div>
    );
  }
}

export default Home;
